const Rate =({rating})=>
{ let starArray=[];
  for(let i=0;i<5;i++){
      if(i<rating)
            starArray.push(<span>★</span>)
      else
              starArray.push(<span>☆</span>)

      }


  return(
    starArray
  )
}
export default Rate ;
